import { GET_BOOKING, REMOVE_BOOKING } from "./actionTypes";
import axios from "axios";

export const getBooking = () => async (dispatch) => {
  try {
    const res = await axios.get("/api/booking/mybooking");
    dispatch({
      type: GET_BOOKING,
      payload: res.data,
    });
  } catch (err) {
    console.log(err.message);
  }
};
